import React from "react";
//======================================================================//
const PhotoGrid = ({ place }) => (
  <div style={{position:"relative"}}>
    <img
      alt="sihgts"
      style={{ width: "300px", height: "400px", padding: "10px",  opacity: '0.7'
    }}
      src={place.photosUrl}
    />
    <div style={{textAlign:"center",width:"80px",height:"40px",bottom:'40px',left:"120px",position:'absolute',backgroundColor:'white',color:'black',}}>{place.name}</div>
  </div>
);

export default PhotoGrid;
